import React, { Component } from 'react';

import Card from './Card';

export default class List extends Component {

    addNewTaskHandler = (e, taskTitle, taskDescription) => {
        return 
    }

    render() {
        let cards = this.props.cards.map((card) => {
            return ( <Card  {...card} key={card.id}/>
                // <Card id={card.id} 
                //     key={card.id}
                //     cardTitle={card.cardTitle}
                //     description={card.description}
                //     status={card.status}
                //     level={card.level}
                //     tasks={card.taskTitle} /> 
            )
        });

        const newTaskTitle = this.props.taskTitle;
        const newTaskDesc = this.props.taskDescription;

        return(
            <div className="List">
                <h1 className="List__title">{this.props.title}</h1>
                {cards}
                <input 
                    type="text" 
                    placeholder="Enter new task" 
                    onSubmit={(e) => this.addNewTask(e, newTaskTitle, newTaskDesc)}/>
                <button className="btn">+</button>
            </div>
        )
    }
}
